userDefinedLinkHintCss:
/* HUD */

iframe.vimiumHUDFrame {
    height: 30px;
    min-height: 30px;
}

div.vimiumHUD {
    background-color: #282c34;
    border-color: #4b5263;
    border-radius: 0;
    border-style: solid;
    border-width: 0 3px 0 0;
    color: #4b5263;
font-family: "Recursive Sn Lnr St";
    font-weight: bold;
    padding: 8px;
    text-shadow: none;
}

div.vimiumHUD .vimiumHUDSearchArea {
  background-color: #282c34;
font-family: "Recursive Sn Lnr St";
  color: #abb2bf;
}

/* Link Hints */

div > .vimiumHintMarker {
    background: #282c34;
    border-color: #4b5263;
    border-radius: 0;
    border-style: solid;
    border-width: 0 0 0 3px;
    cursor: default;
    padding: 4px;
}

div > .vimiumHintMarker span {
    color: #abb2bf;
    cursor: default;
    font-family: "Recursive Sn Lnr St";
    font-size: 12px;
    font-weight: bold;
    text-shadow: none;
}

div > .vimiumActiveHintMarker span {
font-family: "Recursive Sn Lnr St";
    color: #61afef!important;
}

/* Vomnibar */

#vomnibar {
font-family: "Recursive Sn Lnr St";
    background: #282c34;
    border-radius: 0;
    box-shadow: none;
}

#vomnibar .vomnibarSearchArea {
font-family: "Recursive Sn Lnr St";
    background-color: #282c34;
    border: none;
    border-color: #4b5263;
    border-radius: 0;
    border-style: solid;
    border-width: 0 0 0 4px;
}

#vomnibar .vomnibarSearchArea > input {
    background-color: #282c34;
    border: none;
font-family: "Recursive Sn Lnr St";
    color: #abb2bf;
}

#vomnibar ul {
font-family: "Recursive Sn Lnr St";
    background-color: #282c34;
    border-radius: 0;
}

#vomnibar li {
    background-color: transparent;
    border-color: #61AFEF;
    border-style: solid;
font-family: "Recursive Sn Lnr St";
    border-width: 0;
    margin-top: 10px;
    transition: background-color 0.1s ease;
}

#vomnibar li em,
#vomnibar li .vomnibarTitle {
font-family: "Recursive Sn Lnr St";
    color: #abb2bf;
}

#vomnibar li em .vomnibarMatch,
#vomnibar li .vomnibarTitle .vomnibarMatch,
#vomnibar li .vomnibarMatch {
font-family: "Recursive Sn Lnr St";
    color: #c678dd;
}

#vomnibar li .vomnibarUrl {
font-family: "Recursive Sn Lnr St";
    color: #61afef;
}

#vomnibar li.vomnibarSelected {
font-family: "Recursive Sn Lnr St";
    background-color: #2d323b;
}
